window.bookSummaryJSON = "<p>This new Cyanide Publishing edition contains three classic audiobooks by Maurice LeBlanc as well as background articles, including:</p> <ul> <li><i>Maurice LeBlanc: Formidable Fiction in France</i></li> <li><i>Maurice LeBlanc: A Bibliography</i></li> <li><i>The Gentleman Thief: A Suave and Sophisticated Criminal</i></li> </ul> <p><i>The Extraordinary Adventures of Arsene Lupin, Gentleman Burglar</i> (1907)</p> <p>Follow the exploits of Arsene Lupin, the greatest of all white-glove thieves and the original gentleman burglar.</p> <p><i>Arsene Lupin</i> (1909)</p> <p>Mystery and tension build, but humor prevails throughout as Monsieur Lupin and Chief Inspector Guerchard try mightily to outwit each other. Slapstick humor, witty asides, and some unexpected twists.</p> <p><i>Arsene Lupin Versus Herlock Sholmes</i> (1910)</p> <p>Arsene Lupin comes up against a worthy adversary - the British detective Herlock Sholmes.</p> <p><b>Visit www.CyanidePublishing.com to download your free crime/mystery starter library.</b></p>"; 
